// content.js

chrome.runtime.onMessage.addListener(function(request, sender, sendResponse) {
  if (request.showImage) {
    if (!document.getElementById('my-extension-image')) {
      let img = document.createElement('img');
      img.id = 'my-extension-image';
      // ここでData URLを使用
      img.src = 'data:image/png;base64,';  // この後に完全なData URLを続けます

      img.style.position = 'fixed';
      img.style.top = '0';
      img.style.left = '0';
      img.style.zIndex = '1000';
      document.body.appendChild(img);
      sendResponse({status: '画像を表示しました'});
    }
  } else {
    let img = document.getElementById('my-extension-image');
    if (img) {
      img.remove();
      sendResponse({status: '画像を非表示にしました'});
    }
  }
});
